const Home = () => {
    return (
        <div className="home">
            <h2> Homepage </h2>
            <form>
                <label> Blog title: </label>
                <input
                    type="text"
                    required
                />
                <label> Blog body: </label>
                <textarea
                    required
                ></textarea>
                <button>Add blog</button>    
            </form>
        </div>
    );
}
 
export default Home;
